import React from 'react'

const EventList = () => {

  axios.get('https://www.postman.com/collections/729672539796b9f959df')
  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });

  return (
    <div>EventList</div>
  )
}

export default EventList
